import React from "react";
import ReactAnimatedWeather from "react-animated-weather";

export default function WeatherIcon(props) {
  let iconMapping = {
    "01d": "CLEAR_DAY",

    O1n: "CLEAR-NIGHT",
    "02d": "PARTLY_CLOUDY_DAY",
    "02n": "PARTLY_CLOUDY_NIGHT",
  };

  CLEAR_DAY;
  CLEAR_NIGHT;
  PARTLY_CLOUDY_DAY;
  PARTLY_CLOUDY_NIGHT;
  CLOUDY;
  RAIN;
  SLEET;
  SNOW;
  WIND;
  FOG;

  return (
    <ReactAnimatedWeather
      icon="CLEAR_DAY"
      color="goldenrod"
      size={65}
      animate={true}
    />
  );
}
